import React, { Component } from 'react';


export default class index extends Component {
    constructor(props) {
        super(props);
        this.state = {
          returnTestList: [],
        }
      }

    componentDidMount() {
        this.getReturnTest()
    }

    getReturnTest = () => {
    this.props.ajaxUtil.sendRequest(
      this.props.url_Inventory.RETURN_FILE_LIST_URL,
      {},
      (response) => {
        if (!response.status) {
          this.props.setNotification({
            message: response.message,
            hasError: response.status,
            timestamp: new Date().getTime()
          });
        } else {
          if (response.hasOwnProperty('data')) {
            this.setState({ returnTestList: response.data.content })
            console.log(response.data.content)
          }
        }
      },
      this.props.loadingFunction,
      { method: 'GET', isShowSuccess: false }
    );
  }

render(){
return(

    <p>{this.state.returnTestList}</p>
)
}

}
